import React from "react";
import styled from "styled-components";

const FooterContainer = styled.div`
  background-color: #f9f9f9;
  height: auto;
  /* & > .textContainer {
    max-width: 45rem;
    width: auto;
    height: 200px;
    margin: auto;
  } */
`;

const Footer = () => {
  return <FooterContainer>Footer</FooterContainer>;
};

export default FooterContainer;
